import React, {Component} from 'react'
import classes from './App.module.css'

class App extends Component {
  render() {
    return (
        <div className={classes.App}>
          <nav>
              <ul>
                  <li>HOME</li>
                  <li>ABOUT</li>
              </ul>
          </nav>
        </div>
    )
  }
}

export default App;
